import{_ as a,o as e,c as r,Q as t}from"./chunks/framework.ab515e0e.js";const b=JSON.parse('{"title":"常见问题 - 共有问题","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"qa/common.md","filePath":"qa/common.md","lastUpdated":1735985925000}'),o={name:"qa/common.md"},i=t('<h1 id="常见问题-共有问题" tabindex="-1">常见问题 - 共有问题 <a class="header-anchor" href="#常见问题-共有问题" aria-label="Permalink to &quot;常见问题 - 共有问题&quot;">​</a></h1><h2 id="为什么搜不到-xxx-歌-能不能支持-vip" tabindex="-1">为什么搜不到 XXX 歌，能不能支持 VIP <a class="header-anchor" href="#为什么搜不到-xxx-歌-能不能支持-vip" aria-label="Permalink to &quot;为什么搜不到 XXX 歌，能不能支持 VIP&quot;">​</a></h2><p>🙅‍ 软件本身<strong>没有 VIP 的概念</strong>。搜索功能和软件无关，和<strong>具体插件实现</strong>有关。如果你使用的是示例插件，请参考 <a href="https://github.com/maotoumao/MusicFreePlugins" target="_blank" rel="noreferrer">示例插件的声明</a>。</p><blockquote><p>插件只是示例，来自于网络公开的接口，并过滤掉所有 VIP/收费/试听歌曲。仅供学习参考使用，请不要用于任何商业用途，合理合法使用。<br> <strong>以后示例插件仓库也没有任何类似 “破解” 行为的打算。</strong></p></blockquote><h2 id="为什么部分插件没有导入歌单-单曲的功能" tabindex="-1">为什么部分插件没有导入歌单/单曲的功能 <a class="header-anchor" href="#为什么部分插件没有导入歌单-单曲的功能" aria-label="Permalink to &quot;为什么部分插件没有导入歌单/单曲的功能&quot;">​</a></h2><p>原因同上。</p><h2 id="为什么导入歌单或者单曲时丢失部分歌" tabindex="-1">为什么导入歌单或者单曲时丢失部分歌 <a class="header-anchor" href="#为什么导入歌单或者单曲时丢失部分歌" aria-label="Permalink to &quot;为什么导入歌单或者单曲时丢失部分歌&quot;">​</a></h2><p>原因同上。</p><h2 id="为什么某首歌无法播放-只能播放一部分" tabindex="-1">为什么某首歌无法播放/只能播放一部分 <a class="header-anchor" href="#为什么某首歌无法播放-只能播放一部分" aria-label="Permalink to &quot;为什么某首歌无法播放/只能播放一部分&quot;">​</a></h2><p>原因同上，但：</p><ol><li><p>如果是移动端后台运行时播完一首歌就停，先确认下是否在系统设置中把允许后台运行打开。</p></li><li><p>如果是遇到某首歌就暂停，可能是因为这首歌失效了，并且设置中打开了“播放失败时自动暂停”</p></li><li><p>如果非以上原因无法播放，可能是因为这首歌的音源链接是个死链，这种情况下会自动暂停。</p></li><li><p>如果是一首歌只能播放一部分，那八成这首歌是个 VIP 试听歌曲，插件没过滤干净。</p></li><li><p>如果是偶尔只能播放一小部分，可能是因为插件返回的音源链接有失效时间，重新播放一下就好了。</p></li></ol><h2 id="为什么不同音质的歌曲听起来没区别-无法切换音质" tabindex="-1">为什么不同音质的歌曲听起来没区别 / 无法切换音质 <a class="header-anchor" href="#为什么不同音质的歌曲听起来没区别-无法切换音质" aria-label="Permalink to &quot;为什么不同音质的歌曲听起来没区别 / 无法切换音质&quot;">​</a></h2><p>原因基本同上，是否拥有不同音质的音乐由插件决定。软件内会根据设置，在某个音质缺失时，自动用更高或更低音质代替。</p><h2 id="软件能不能支持-xxx-音质" tabindex="-1">软件能不能支持 XXX 音质 <a class="header-anchor" href="#软件能不能支持-xxx-音质" aria-label="Permalink to &quot;软件能不能支持 XXX 音质&quot;">​</a></h2><p>上面解释过，是否拥有不同音质的音乐由插件决定。软件预先定义了 4 种音质，但具体支持哪种音质，由插件决定。</p><h2 id="为什么插件安装失败" tabindex="-1">为什么插件安装失败 <a class="header-anchor" href="#为什么插件安装失败" aria-label="Permalink to &quot;为什么插件安装失败&quot;">​</a></h2><p>如果是从网络安装插件，需要注意：输入的内容是 <strong>结尾是 .json 或者 .js</strong> 的链接，不是奇奇怪怪的 json。</p><p>如果确定输入的是正确的 URL，且 URL 指向的是 MusicFree 的插件，可能是由于网络错误，过一会再试试，或者下载下来然后安装本地插件。</p><h2 id="下载文件是否能修改文件名" tabindex="-1">下载文件是否能修改文件名？ <a class="header-anchor" href="#下载文件是否能修改文件名" aria-label="Permalink to &quot;下载文件是否能修改文件名？&quot;">​</a></h2><p>下载文件名暂时不能改，因为歌曲信息没写在文件中，暂时是靠歌名来区分的，所以命名才这么奇怪。。</p><h2 id="musicfree-是否有收费-添加广告的计划" tabindex="-1">MusicFree 是否有收费/添加广告的计划 <a class="header-anchor" href="#musicfree-是否有收费-添加广告的计划" aria-label="Permalink to &quot;MusicFree 是否有收费/添加广告的计划&quot;">​</a></h2><p>现在没有，以后也没有。（Github 给个 star 就行了😈</p><h2 id="应用市场上的-musicfree-和本项目有什么关系" tabindex="-1">应用市场上的 MusicFree 和本项目有什么关系？ <a class="header-anchor" href="#应用市场上的-musicfree-和本项目有什么关系" aria-label="Permalink to &quot;应用市场上的 MusicFree 和本项目有什么关系？&quot;">​</a></h2><p>无任何关系，本项目仅在 Github 和公众号【一只猫头猫】发布。</p>',24),l=[i];function n(s,h,c,p,d,u){return e(),r("div",null,l)}const _=a(o,[["render",n]]);export{b as __pageData,_ as default};
